import React from 'react';
import { Table } from 'reactstrap';
import fetch from 'isomorphic-unfetch';


class ProjectTable extends React.Component{
  constructor(props) {
    super(props);
    // Don't call this.setState() here!
    this.state = { };
  }
  render() {
    return (
      <div style={{textAlign:"center"}}> 
      <div style={{display: "inline-block"}}>
      <Table bordered style={{width:"80vw"}}>
      <thead>
        <tr>
          <th>#</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Username</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <th scope="row">1</th>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
        <tr>
          <th scope="row">2</th>
          <td>Jacob</td>
          <td>Thornton</td>
          <td>@fat</td>
        </tr>
        <tr>
          <th scope="row">3</th>
          <td>Larry</td>
          <td>the Bird</td>
          <td>@twitter</td>
        </tr>
      </tbody>
    </Table>
      </div>
            
      </div>
    
  );
  }
  
}

export default ProjectTable;
